&lt;p&gt;The Department of Agriculture, Fisheries and Forestry is part of the Australian Government with diverse roles and functions.  The department:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;works to enhance Australia's agricultural, fisheries and forestry industries&lt;/li&gt;
&lt;li&gt;creates new and maintains existing agricultural export opportunities, to provide gains for Australian agriculture&lt;/li&gt;
&lt;li&gt;manages biosecurity risks to Australia to protect our multi-billion dollar agricultural industries and our way of life.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;To deliver the functions as set out in the &lt;a class=&quot;external-link external-link-end&quot; href=&quot;https://www.pmc.gov.au/resource-centre/government/administrative-arrangements-order&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Administrative Arrangements Orders&lt;/a&gt;, the department:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;provides advice to the Australian Government&lt;/li&gt;
&lt;li&gt;delivers programs&lt;/li&gt;
&lt;li&gt;administers legislation including as a significant regulator in the Australian economy.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;As a regulator the department enforces laws relating to:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;pest and disease risks of goods, people and vessels arriving in Australia&lt;/li&gt;
&lt;li&gt;agricultural goods exported from Australia&lt;/li&gt;
&lt;li&gt;imported food safety&lt;/li&gt;
&lt;li&gt;imported wood and paper products&lt;/li&gt;
&lt;li&gt;agricultural levies.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;The Department of Agriculture, Fisheries and Forestry provides grants, invests in new initiatives and supports Australians to help boost productivity and exports. They use tenders to buy goods and services from other organisations.&lt;/p&gt;
&lt;p&gt;Visit the department's website on &lt;a href=&quot;https://www.agriculture.gov.au/&quot;&gt;https://www.agriculture.gov.au&lt;/a&gt; to learn more&lt;/p&gt;

