&lt;p&gt;The ARC is a Commonwealth entity within the Australian Government. Its mission is to deliver policy and programs that advance Australian research and innovation globally and benefit the community.The ARC provides advice to the Government on research matters and manages the National Competitive Grants Program (NCGP), a significant component of Australia's investment in research and development. Through the NCGP, the ARC funds the highest quality fundamental and applied research and research training through national competition across all disciplines, with the exception of clinical medicine and dentistry. The ARC is also responsible for administering the Excellence in Research for Australia (ERA) initiative.&lt;/p&gt;
&lt;p&gt;The ARC provides it's own search service for their awarded grants as well as a downloadable spreadsheet at https://www.arc.gov.au/grants-and-funding/apply-funding/grants-dataset.&lt;/p&gt;
&lt;p&gt;See &lt;a title=&quot;ARC Grant Information Terms of Use&quot; href=&quot;https://documentation.ardc.edu.au/display/DOC/ARC+Grants+Information+Terms+of+Use&quot;&gt;ARC Grant Information Terms of Use&lt;/a&gt; for details about the grant information provided by the ARC.&lt;/p&gt;
